import Login from './Login'
import './App.css'
import Main from './Main'
import Test from './test'
import { Link,BrowserRouter as Router, Route, Routes } from 'react-router-dom';
function App() {


  return (
    <div className="App">
      <App />

    </div>

  )
  return (
    <div>
      <Router>
        <Routes>
          <Route exact path="/" element={<Login />} />
          <Route exact path="/main" element={<Main />} />
        </Routes>
      </Router>
    </div>
  )

}

export default App;
